package com.fishercoder.firstthousand;

import com.fishercoder.solutions.firstthousand._686;
import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.Test;

import static org.junit.jupiter.api.Assertions.assertEquals;

public class _686Test {
    private _686.Solution1 solution1;
    private _686.Solution2 solution2;

    @BeforeEach
    public void setup() {
        solution1 = new _686.Solution1();
        solution2 = new _686.Solution2();
    }

    @Test
    public void test1() {
        assertEquals(3, solution1.repeatedStringMatch("abcd", "cdabcdab"));
        assertEquals(3, solution2.repeatedStringMatch("abcd", "cdabcdab"));
    }

    @Test
    public void test2() {
        assertEquals(1, solution1.repeatedStringMatch("aa", "a"));
        assertEquals(1, solution2.repeatedStringMatch("aa", "a"));
    }

    @Test
    public void test3() {
        assertEquals(2, solution1.repeatedStringMatch("a", "aa"));
        assertEquals(2, solution2.repeatedStringMatch("a", "aa"));
    }

    @Test
    public void test4() {
        assertEquals(-1, solution1.repeatedStringMatch("abcabcabcabc", "abac"));
        assertEquals(-1, solution2.repeatedStringMatch("abcabcabcabc", "abac"));
    }

    @Test
    public void test5() {
        assertEquals(-1, solution1.repeatedStringMatch("abaabaa", "abaababaab"));
        assertEquals(-1, solution2.repeatedStringMatch("abaabaa", "abaababaab"));
    }

    @Test
    public void test6() {
        assertEquals(-1, solution1.repeatedStringMatch("",
                ""));
        assertEquals(-1, solution2.repeatedStringMatch("",
                ""));
    }

}
